import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import { Routes} from 'react-router-dom';
import Home from './Components/Home.js';
import StudentRegister from './Components/StudentRegister'; // Import StudentRegister component
import FacultyRegister from './Components/FacultyRegister'; // Import FacultyRegister component
import SecurityRegister from './Components/SecurityRegister'; // Import SecurityRegister component
import './App.css';

const App = () => (
  <Router>
    <Routes>
      <Route exact path="/" component={Home} />
      <Route path="/StudentRegister" component={StudentRegister} />
      <Route path="/FacultyRegister" component={FacultyRegister} />
      <Route path="/SecurityRegister" component={SecurityRegister} />
    </Routes>
  </Router>
);

export default App;
